// Navbar.js

import React, { useState } from 'react';
import LunchDiningIcon from '@mui/icons-material/LunchDining';
import CloseRoundedIcon from '@mui/icons-material/CloseRounded';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="flex justify-between items-start px-4 py-1 bg-accent text-dark">
      <div className="text-2xl font-bold">D.</div>

      <div className="flex flex-col justify-center">
        <button
          className="lg:hidden text-xl focus:outline-none right-0 flex justify-end"
          onClick={toggleMenu}
        >
          {isOpen ? <CloseRoundedIcon /> : <LunchDiningIcon />}
        </button>

        <div className={`lg:flex ${isOpen ? 'flex' : 'hidden'} items-center h-full bg-pink-300 lg:flex-row font-semibold`}>
          <div className="lg:mx-2 my-2 lg:my-0">HOME</div>
          <div className="lg:mx-2 my-2 lg:my-0">SKILLS</div>
          <div className="lg:mx-2 my-2 lg:my-0">WORKS</div>
          <div className="lg:mx-2 my-2 lg:my-0">CONTACT ME</div>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
